@wangxin I think it's better to reuse the stdout callback plugin from ansible to convet the result obj to strings, since stdout callback would like to filter out some internal vars of ansible for us. 
And it's better to create a separate common function instead of a method, sinice we may need the function outside class 'RunAnsibleModuleFail'.

So, i mean just catch the exception when converting the error obj to strings in 'dump_ansible_results'.

@navneeth2666 Thanks for your suggestions!

The ansible module result is logged as json text. A workaround is to copy result and paste to a modern tool like vscode or atom to beautify the text. Then the stdout lines can be displayed in a neat way.

I could have output the ansible module result using method like `json.dumps(result, indent=2)`. Then we can have well formatted output in the first place. But my concern is that such prettified json output may occupy much more lines in the log than the raw json text. This would increase the effort of scrolling up and down while checking the logs.

